import React from 'react';

class About extends React.Component {
	render() {
		return (
			<section className='cv-container'>
				<article className='cv-column' id='personal'>
					<div className='cv-block'>
						<h2>Cameron<br />McDougall</h2>
						<span>hello@cameronmcdougall.eu</span>
					</div>
				</article>
				<article className='cv-column' id='specs'>
					<div className='cv-block'>
						<h4>Skills</h4>
						<h5>Design</h5>
						<p>Front End Development<span className='pipe'>|</span>UX/UI Design<span className='pipe'>|</span>Graphic + Print Design<span className='pipe'>|</span>Typography<span className='pipe'>|</span>Branding + Identity<span className='pipe'>|</span>Layout<span className='pipe'>|</span>Photography</p>
						<h5>Languages + Frameworks</h5>
						<p>HTML5<span className='pipe'>|</span>CSS3<span className='pipe'>|</span>ES6 Javascript<span className='pipe'>|</span>PHP<span className='pipe'>|</span>ReactJS<span className='pipe'>|</span>jQuery</p>
						<h5>App Proficiency</h5>
						<p>Sublime Text + Dreamweaver<span className='pipe'>|</span>InDesign<span className='pipe'>|</span>Photoshop<span className='pipe'>|</span>Illustrator<span className='pipe'>|</span>Git<span className='pipe'>|</span>Adobe XD</p>

					</div>
				</article>
			</section>
		);
	}
}

export default About;
